import "./Board.css";
import Box from "./Box";

const Board = ({ board, onClick }) => {
  return (
    <div>
      {board.map((value, index) => {
        <Box
          value={value}
          onClick={() => {
            onClick(index);
          }}
        />;
      })}
    </div>
  );
};

export default Board;
